import Link from 'next/link'

export function MainLayout ({children}) {
    return (
        <>
            <nav>
                <Link href={'/'}><a>Home</a></Link>
                <Link href={'/cards'}><a>Cards</a></Link>
                <Link href='/auth'><a>Auth</a></Link>
            </nav>
            <main>
                {children}
            </main>
            <style jsx>{
                `
                nav {
                    position: fixed;
                    height: 60px;
                    left: 0;
                    right: 0;
                    top: 0;
                    background: darkblue;
                    display: flex;
                    justify-content: space-around;
                }

                nav a {
                    color: #fff;
                    margin-left: 10px;
                }
                `
            }</style>
        </>
    )
}
